import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import Modal from 'react-modal';

const register = () => {
  return (
      <div className="registermodal">
      <div className="row">
        <div class="registermodal_card_type position-relative col-6">
          <h6>5 კაციანი</h6>
          <div class="registermodal_card_border"></div>
          <span class="registermodal_card_dot ml-auto"></span>
        </div>
        <div class="register_card_button mt-3  col-6">
          <div className="row">
            <div className="col-6"><a class="button " href="#">5 ლარი</a></div>
            <div className="col-6"></div>
          </div>
           
        </div>
      </div>
      </div>

  )
}

export { register }
